  return (
    <DashboardStyled>
        <InnerLayout>
            <h1>All Transction</h1>
            <div className='stats-con'>
              <div className='chart-con'>
                <Chart />
              </div>
            </div>
        </InnerLayout>
    </DashboardStyled>
  )
}

